--

CREATE FUNCTION snapshot(text, json) RETURNS void
    LANGUAGE plpgsql
    AS $_$
BEGIN
	    VALUES($1, $2)
	    ON CONFLICT(id) DO
	      UPDATE SET doc = EXCLUDED.doc, ts = now() WHERE snapshot.id = EXCLUDED.id;
END;
$_$;


