-- Name: convert_stop(interval, interval); Type: FUNCTION; Schema: incoming; Owner: rngadam
--

CREATE FUNCTION convert_stop(interval, interval) RETURNS interval
    LANGUAGE plpgsql IMMUTABLE
    AS $_$
BEGIN
 	IF extract(epoch FROM $2 - $1) < 0 THEN
 		RETURN ($2 + INTERVAL '24 hours');
 	END IF;
	RETURN $2;
END;
$_$;


