--
-- Name: timesheet; Type: VIEW; Schema: model; Owner: rngadam
--

CREATE VIEW timesheet AS
 SELECT entry.id,
    project.id AS project_id,
    membership.id AS membership_id,
    account.id AS account_id,
    organization.id AS organization_id,
    person.id AS person_id,
    organization.name AS organization_name,
    project.name AS project_name,
    account.name AS account_name,
    person.name AS person_name,
    membership.name AS membership_name,
    entry.start_datetime,
    entry.stop_datetime,
    person.email,
    task.name AS task_name,
    entry.properties,
    rate.currency,
    rate.rate,
    (entry.stop_datetime - entry.start_datetime) AS duration,
    (utils.to_numeric_hours((entry.stop_datetime - entry.start_datetime)) * (rate.rate * ((1)::numeric - COALESCE(rate.discount, (0)::numeric)))) AS total,
    (utils.to_numeric_hours((entry.stop_datetime - entry.start_datetime)) * (rate.rate * COALESCE(rate.discount, (0)::numeric))) AS total_discount
   FROM ((((((((entry
     JOIN membership ON ((entry.membership_id = membership.id)))
     JOIN task ON ((entry.task_id = task.id)))
     JOIN person ON ((membership.person_id = person.id)))
     JOIN project ON ((membership.project_id = project.id)))
     JOIN account ON ((project.account_id = account.id)))
     JOIN organization ON ((account.organization_id = organization.id)))
     JOIN rate ON ((membership.id = rate.membership_id)))
     JOIN iso4217 ON ((rate.currency = iso4217.code)));


ALTER TABLE timesheet OWNER TO rngadam;

--
-- Name: add_entry(text, text, timestamp with time zone, timestamp with time zone, text, jsonb); Type: FUNCTION; Schema: model; Owner: rngadam
--

CREATE FUNCTION add_entry(project_name text, email_ text, start_datetime timestamp with time zone, stop_datetime timestamp with time zone, task_name text, properties jsonb) RETURNS timesheet
    LANGUAGE plpgsql
    AS $$
DECLARE
	entry model.entry;
	task model.task;
	project model.project;
	membership model.membership;
	ts model.timesheet;
BEGIN
	SELECT * INTO task FROM model.task t WHERE t.name = task_name;
	IF task IS NULL THEN
		RAISE EXCEPTION 'Nonexistent task --> %', task_name USING HINT = 'Create task';
	END IF;
	SELECT * INTO project FROM model.project WHERE name = project_name;
	IF project IS NULL THEN
		RAISE EXCEPTION 'Nonexistent project --> %', project_name USING HINT = 'Create project';
	END IF;
	SELECT * INTO membership
		FROM model.membership m
			INNER JOIN model.person p ON p.id = m.person_id 
		WHERE p.email = email_ AND m.project_id = project.id;
	IF membership IS NULL THEN
		RAISE EXCEPTION 'Nonexistent membership --> %', email_ USING HINT = 'Create membership with this email';
	END IF;

		start_datetime, 
		stop_datetime, 
		task_id, 
		membership_id,
		properties) 
	VALUES (
		start_datetime,
   		stop_datetime,
   		task.id,
   		membership.id,
   		properties) 
	RETURNING * INTO entry;

	SELECT * INTO ts 
		FROM model.timesheet t WHERE t.id = entry.id;

	RETURN ts;
END;
$$;


ALTER FUNCTION model.add_entry(project_name text, email_ text, start_datetime timestamp with time zone, stop_datetime timestamp with time zone, task_name text, properties jsonb) OWNER TO rngadam;

