--
-- Name: refresh_data_conditional(); Type: FUNCTION; Schema: postgraphql; Owner: rngadam
--

CREATE FUNCTION refresh_data_conditional(OUT last_refresh timestamp with time zone, OUT last_update timestamp with time zone, OUT last_refresh_now timestamp with time zone) RETURNS record
    LANGUAGE plpgsql
    AS $$
BEGIN
	SELECT 
		organization.last_refresh,
		(CASE WHEN organization.last_refresh < (SELECT max(project.last_update) FROM incoming.project) THEN (select postgraphql.refresh_data()) ELSE organization.last_refresh END) FROM postgraphql.organization;	
END;
$$;


