CREATE FUNCTION convert_to_interval(text) RETURNS interval
    LANGUAGE plpgsql IMMUTABLE
    AS $_$
BEGIN
  -- covers 00:00 TO xx:00 hours
  RETURN $1::interval;
EXCEPTION WHEN OTHERS THEN
  BEGIN
  -- covers 00:00 AM|PM
  	RETURN $1::time::interval;
  EXCEPTION WHEN OTHERS THEN
   	RETURN NULL;  -- NULL for other invalid input
  END;
END
$_$;


