CREATE VIEW entry AS
 SELECT (converted.date + converted.start) AS start_datetime,
    (converted.date + convert_stop(converted.start, converted.stop)) AS stop_datetime,
    converted.start,
    convert_stop(converted.start, converted.stop) AS stop,
    (convert_stop(converted.start, converted.stop) - converted.start) AS duration,
    converted.resource,
    converted.project_id,
    converted.taskname,
    converted.activity
   FROM ( SELECT ((element.element ->> 'date'::text))::timestamp with time zone AS date,
            convert_to_interval((element.element ->> 'start'::text)) AS start,
            convert_to_interval((element.element ->> 'stop'::text)) AS stop,
            btrim(COALESCE((element.element ->> 'resource'::text), (element.element ->> 'name'::text))) AS resource,
            element.id AS project_id,
            (element.element ->> 'taskname'::text) AS taskname,
            (element.element ->> 'activity'::text) AS activity
           FROM raw_entry element
          WHERE (((length((element.element ->> 'resource'::text)) > 0) OR (length((element.element ->> 'name'::text)) > 0)) AND (length((element.element ->> 'date'::text)) > 0))) converted
  WHERE ((converted.start IS NOT NULL) AND (converted.stop IS NOT NULL) AND (converted.start <> converted.stop))
  ORDER BY (converted.date + converted.start);


