--
-- Name: warnings; Type: VIEW; Schema: incoming; Owner: rngadam
--

CREATE VIEW warnings AS
 SELECT all_errors.doc,
    all_errors.table_name,
    all_errors.error
   FROM ( SELECT to_json(profile.*) AS doc,
            'incoming.profile'::text AS table_name,
            'email must be present for all profiles'::text AS error
           FROM profile
          WHERE (profile.email IS NULL)
        UNION ALL
         SELECT to_json(entry.*) AS doc,
            'incoming.entry'::text AS table_name,
            'time entry is negative'::text AS error
           FROM entry
          WHERE (date_part('epoch'::text, entry.duration) < (0)::double precision)
        UNION ALL
         SELECT to_json(entry.*) AS doc,
            'incoming.entry'::text AS table_name,
            'no task name given'::text AS error
           FROM entry
          WHERE (entry.taskname IS NULL)
        UNION ALL
         SELECT to_json(entry.*) AS doc,
            'incoming.entry'::text AS table_name,
            'no activity name given'::text AS error
           FROM entry
          WHERE (entry.taskname IS NULL)
        UNION ALL
         SELECT (format('{"project_id": "%s"}'::text, entry.project_id))::json AS doc,
            'incoming.entry'::text AS table_name,
            'taskname is on average longer than activity - reversed?'::text AS error
           FROM entry
          WHERE ((entry.activity IS NOT NULL) AND (entry.taskname IS NOT NULL))
          GROUP BY entry.project_id
         HAVING (avg(length(entry.taskname)) > avg(length(entry.activity)))
        UNION ALL
         SELECT to_json(entry.*) AS doc,
            'incoming.entry'::text AS table_name,
            'resource is null or length 0'::text AS error
           FROM entry
          WHERE ((entry.resource IS NULL) OR (length(entry.resource) = 0))
        UNION ALL
         SELECT to_json(entry.*) AS doc,
            'incoming.entry'::text AS table_name,
            'resource does not match anything in people'::text AS error
           FROM (entry
             LEFT JOIN people ON ((entry.resource = ANY (people.nicknames))))
          WHERE (people.fullname IS NULL)
        UNION ALL
         SELECT to_json(people.*) AS doc,
            'incoming.people'::text AS table_name,
            'no email for a people entry'::text AS error
           FROM people
          WHERE (people.email IS NULL)
        UNION ALL
         SELECT to_json(raw_people.*) AS doc,
            'incoming.raw_people'::text AS table_name,
            'no key rate specified'::text AS error
           FROM raw_people
          WHERE ((raw_people.doc ->> 'rate'::text) IS NULL)
        UNION ALL
         SELECT to_json(raw_people.*) AS doc,
            'incoming.raw_people'::text AS table_name,
            'no key rate specified'::text AS error
           FROM raw_people
          WHERE ((raw_people.doc ->> 'rate'::text) IS NULL)
        UNION ALL
         SELECT to_json(entry.*) AS doc,
            'incoming.entry'::text AS table_name,
            'duration is negative'::text AS error
           FROM entry
          WHERE (date_part('epoch'::text, entry.duration) < (0)::double precision)
        UNION ALL
         SELECT (array_agg(to_json(people_project.*)))[1] AS doc,
            'incoming.people_project'::text AS table_name,
            format('multiple resource matches for resource " %s" email "%s" count "%s"'::text, people_project.resource, people_project.email, count(*)) AS error
           FROM people_project
          GROUP BY people_project.project_id, people_project.email, people_project.resource
         HAVING (count(*) > 1)) all_errors;


