CREATE VIEW project AS
 SELECT timesheet.project_id,
    timesheet.project_name,
    timesheet.organization_name,
    count(*) AS entry_count,
    round(utils.to_numeric_hours(sum(timesheet.duration)), 2) AS total_entry_hours,
    round(utils.to_numeric_hours(avg(timesheet.duration)), 2) AS avg_entry_hours,
    round(utils.to_numeric_hours(min(timesheet.duration)), 2) AS min_entry_hours,
    round(utils.to_numeric_hours(max(timesheet.duration)), 2) AS max_entry_hours,
    min(timesheet.start_datetime) AS first_entry,
    max(timesheet.stop_datetime) AS latest_entry,
    date_part('day'::text, (max(timesheet.stop_datetime) - min(timesheet.start_datetime))) AS activity_days,
    round(sum(timesheet.total), 2) AS total_gross,
    round(sum(timesheet.total_discount), 2) AS total_discount,
    count(DISTINCT timesheet.email) AS person_count
   FROM model.timesheet
  GROUP BY timesheet.project_id, timesheet.project_name, timesheet.organization_name
  ORDER BY (round(sum(timesheet.total), 2)) DESC;


