--
-- Name: summary_person; Type: VIEW; Schema: report; Owner: rngadam
--

CREATE VIEW summary_person AS
 SELECT (round(date_part('hour'::text, sum(entry_people_project.duration))))::integer AS total_hours,
    count(DISTINCT entry_people_project.project_id) AS project_count,
    array_agg(DISTINCT entry_people_project.resource) AS nicknames,
    max(entry_people_project.fullname) AS fullname,
    entry_people_project.email,
    min(entry_people_project.start_datetime) AS first_entry,
    max(entry_people_project.stop_datetime) AS latest_entry,
    (date_part('days'::text, (max(entry_people_project.stop_datetime) - min(entry_people_project.start_datetime))))::integer AS active_days,
    round((avg(date_part('hours'::text, entry_people_project.duration)))::numeric, 1) AS avg_entry_hours
   FROM entry_people_project
  GROUP BY entry_people_project.email
  ORDER BY ((round(date_part('hour'::text, sum(entry_people_project.duration))))::integer) DESC;


