--
-- Name: project_config _RETURN; Type: RULE; Schema: model; Owner: rngadam
--

CREATE OR REPLACE VIEW project_config AS
 SELECT project.id,
    project.name AS project_name,
    max(organization.name) AS organization_name,
    max(account.name) AS account_name,
    array_agg(DISTINCT task.name) AS tasks,
    array_agg(DISTINCT person.name) AS members,
    array_agg(DISTINCT membership.id) AS membership_ids,
    array_agg(DISTINCT task.id) AS task_ids
   FROM (((((project
     JOIN membership ON ((membership.project_id = project.id)))
     JOIN person ON ((membership.person_id = person.id)))
     JOIN task ON ((task.project_id = project.id)))
     JOIN account ON ((project.account_id = account.id)))
     JOIN organization ON ((account.organization_id = organization.id)))
  GROUP BY project.id;


